// SPDX-License-Identifier: MIT

pragma solidity = 0.6.12;


import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC1155/ERC1155Burnable.sol";


/**
 *
 * @notice this is the template for all ERC1155 contract
 *
 */
contract WrappedErc1155 is ERC1155Burnable, AccessControl {
    /**
     * @dev Sets the values for {name} and {symbol}.
     *
     */

    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant WORKER_ROLE = keccak256("WORKER_ROLE");

    // supprt name/symbol
    string private _name;
    string private _symbol;

    constructor(
        string memory name_,
        string memory symbol_,
        string memory baseUri_,
        address  owner_,
        address  admin_,
        address  worker_
    ) public ERC1155(baseUri_) {
        _name = name_;
        _symbol = symbol_;

        _setupRole(DEFAULT_ADMIN_ROLE, owner_);
        _setupRole(ADMIN_ROLE, admin_);
        _setupRole(WORKER_ROLE, worker_);

        _setRoleAdmin(WORKER_ROLE, ADMIN_ROLE);
    }

    /**
     * ============================================================================
     * ROLE check
     * ============================================================================
     */

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(hasRole(DEFAULT_ADMIN_ROLE,  msg.sender), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyWorker() {
        require(hasRole(WORKER_ROLE,  msg.sender), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev for framework
     */
    function name() public view returns (string memory) {
        return _name;
    }

    /**
     * @dev only for framework
     */
    function symbol() public view returns (string memory) {
        return _symbol;
    }

    /// @notice update token name, symbol
    /// @dev update token name, symbol
    /// @param name_ token new name
    /// @param symbol_ token new symbol
    function update(string memory name_, string memory symbol_)
    external
    onlyOwner
    {
        _name = name_;
        _symbol = symbol_;
    }

    // 
    function setURI(string memory newuri_) onlyWorker external {
        _setURI(newuri_);
    }

    function transferOwner(address newOwner_) public onlyOwner {
        _setupRole(DEFAULT_ADMIN_ROLE, newOwner_);
        renounceRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    /// @notice Create token
    /// @dev  Creates `amount` tokens of token type `id`, and assigns them to `account`.
    /// @param account_ Address will receive token
    /// @param tokenID_ ID of token to be minted
    /// @param amount_  token amount
    /// @param data_    data
    function mint(address account_, uint256 tokenID_, uint256 amount_, bytes memory data_)
    external
    onlyOwner
    {
        _mint(account_, tokenID_, amount_, data_);
    }

    /// @notice Create token
    /// @dev  Creates `amount` tokens of token type `id`, and assigns them to `account`.
    /// @param account_ Address will receive token
    /// @param tokenID_ ID of token to be minted
    /// @param amount_  amount
    function burn(address account_, uint256 tokenID_, uint256 amount_) 
    public
    override 
    onlyOwner {
        _burn(account_, tokenID_, amount_);
    }


}

